import React from 'react'

export default function ViewDetail({ pictureSrc }) {
    return (
        <Div>
            <Img src={pictureSrc}/>
        </Div>
    )
}
const Div = styled.div`
    text-align: center;
`;
const Img = styled.img`
    /* padding: 25px; */
    width: 70%;
    height: 30%;
`;
